import{_ as n,r as e,o as s,c,d as a,a as o,w as r,b as p,f as d}from"./app-61e11eef.js";const m={},u=o("h1",{id:"_5-1-cliente-ftp",tabindex:"-1"},"5.1 Cliente FTP",-1),_={class:"table-of-contents"},T=d('<h2 id="_5-2-1-apache-common-net-ftp" tabindex="-1">5.2.1 Apache Common Net FTP</h2><p>La librería Apache Commons Net™ library implementa la parte client de la mayoría de protocolos básicos de Internet.</p><p>El propósito de la biblioteca es proporcionar acceso básico a las funcionalidad de los protocolos, no abstracciones de nivel superior. Por lo tanto, parte del diseño viola los principios de diseño orientado a objetos.</p><p>Nuestra filosofía es hacer que la funcionalidad global de un protocolo sea accesible (por ejemplo, archivo de envío TFTP y archivo de recepción) cuando sea posible, pero también proporcionar acceso a los protocolos básicos cuando corresponda para que el programador pueda construir sus propias implementaciones personalizadas (por ejemplo, se exponen las clases de paquetes TFTP y los métodos de envío y recepción de paquetes TFTP).</p><div class="custom-container tip"><p class="custom-container-title">Jakarta vs Java Mail</p><p>Los protocolos soportados son:</p><ul><li>FTP/FTPS</li><li>FTP over HTTP (experimental)</li><li>NNTP</li><li>SMTP(S)</li><li>POP3(S)</li><li>IMAP(S)</li><li>Telnet</li><li>TFTP</li><li>Finger</li><li>Whois</li><li>rexec/rcmd/rlogin</li><li>Time (rdate) and Daytime</li><li>Echo</li><li>Discard</li><li>NTP/SNTP</li></ul></div>',5);function P(h,f){const i=e("DownloadPDF-component"),l=e("DocumentCover-component"),t=e("router-link");return s(),c("div",null,[a(i),a(l,{titulo:"5.1 Cliente FTP"}),u,o("nav",_,[o("ul",null,[o("li",null,[a(t,{to:"#_5-2-1-apache-common-net-ftp"},{default:r(()=>[p("5.2.1 Apache Common Net FTP")]),_:1})])])]),T])}const v=n(m,[["render",P],["__file","ftp.html.vue"]]);export{v as default};
